import React from 'react';
import Header from './../../components/landingpage/Header'; // Import the Header component
import Footer from './../../components/landingpage/Footer'; // Import the Footer component
import HeroSection from './../../components/landingpage/HeroSection';
import AboutUs from './../../components/landingpage/AboutUs';
import Services from './../../components/landingpage/Services';
import Portfolio from './../../components/landingpage/Portfolio';
import Testimonials from './../../components/landingpage/Testimonials';
import Blog from './../../components/landingpage/Blog';
import Careers from './../../components/landingpage/Careers';
import ContactUs from './../../components/landingpage/ContactUs';
import FAQ from './../../components/landingpage/FAQ';
import "./../../css/landingPage.css";

const LandingPage = () => {
  return (
    <div>
      <Header />
      <HeroSection />
      <AboutUs />
      <Services />
      <Portfolio />
      <Testimonials />
      <Blog />
      <Careers />
      <ContactUs />
      <FAQ />
      <Footer />
    </div>
  );
};

export default LandingPage;
